import React from 'react'


export default class Checkbox extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        isChecked: false,
      };
    }
    
    toggleChange = () => {
      this.setState({
        isChecked: !this.state.isChecked,
      });
      if(this.state.isChecked === true) {
          console.log('pppapap')
      }else{
          console.log('no')
      }
    }
    
    render() {
      return (
        <label>
          <input type="checkbox"
            defaultChecked={this.state.isChecked}
            onChange={this.toggleChange}
          />
          Check Me!
         </label>
      );
    }
  }
